    false,nt"url": null,nt"notes": "Collect and deliver high-density elevation
    point data derived from multiple-return light detection and ranging (LiDAR) measurements
    for use in supporting topographic analysis, including applications such as flood
    plain mapping. The Nominal Point Spacing Value for the final lidar is 3.2 ft (~1
    m). Deliver LiDAR Bare Earth and Contour lines within the areas designated in areas
    of Clay, Itawamba, Monroe, and Lowndes Counties to aid in visual interpretation
    of Flood Basin elevations and for addition to the MDEM elevation dataset. Comply
    with mapping guidelines and specifications as stated in the FEMA Procedure Memorandum
    No. 61",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
